export const Homepage = () => {
    return(
        <div className="d-flex">
            <div style={{width: '20vw', height: '100vw', paddingTop: '3%', paddingLeft: '3%', background: 'white'}}>
                <div className="d-flex align-items-center justify-content-between">
                <img src={process.env.PUBLIC_URL + '/images/pillmatew.png'} style={{width:'129px', height:'58px'}}/>
                <img src={process.env.PUBLIC_URL + '/images/hamburgermenu.png'} style={{width:'40px', height:'40px', paddingRight: '2%',}}/>
                </div>
            </div>
            <div style={{width: '80vw', height: '100vw', background: '#F6F6F6'}}>

            </div>
        </div>
    );
}
